tables.table_schema:
CREATE TABLE click_data (
  id INT PRIMARY KEY,
  email_id INT REFERENCES email_engagement(id),
  clicked_link TEXT NOT NULL,
  click_timestamp TIMESTAMP
);

CREATE TABLE open_rates (
    id INT PRIMARY KEY,
    email_id INT,
    open_time TIMESTAMP
);

CREATE TABLE click_through_rates (
    id INT PRIMARY KEY,
    email_id INT,
    click_time TIMESTAMP
);

CREATE TABLE engagement_data (
    email_id INT,
    interaction_type VARCHAR(10),
    interaction_time TIMESTAMP,
    interaction_count INT
);

CREATE TABLE email_open_rate (
  user_id INT,
  email_id INT,
  open_timestamp TIMESTAMP
);

CREATE TABLE email_click_through_rate (
  click_id INT,
  email_id INT,
  user_id INT,
  click_timestamp TIMESTAMP
);

CREATE TABLE user_details (
  user_id INT PRIMARY KEY,
  user_name VARCHAR(50),
  user_email VARCHAR(100)
);

CREATE TABLE email_details (
  email_id INT PRIMARY KEY,
  subject VARCHAR(255),
  sender_email VARCHAR(100)
);

CREATE TABLE EmailCampaigns (
    campaign_id INT PRIMARY KEY,
    campaign_name VARCHAR(255),
    launch_date DATE
);

CREATE TABLE Contacts (
    contact_id INT PRIMARY KEY,
    email_address VARCHAR(255),
    first_name VARCHAR(100),
    last_name VARCHAR(100)
);

CREATE TABLE OpenRates (
    open_id INT PRIMARY KEY,
    engagement_id INT,
    open_timestamp TIMESTAMP
);

CREATE TABLE ClickThroughRates (
    click_id INT PRIMARY KEY,
    engagement_id INT,
    click_url VARCHAR(255),
    click_timestamp TIMESTAMP
);
